import React from "react";

const Navbar = () => {
  const logo = "</>";
  return (
    <div className="w-screen flex justify-between text-white">
      <div className="font-bold">{logo} CERMUEL</div>
      <div>
        <div>#home</div>
        <div>#aboutMe</div>
        <div>#works</div>
        <div>#contact</div>
      </div>
    </div>
  );
};

export default Navbar;
